import React from "react";
import Toolbar from "../components/Toolbar";
import Sidebar from "../components/Sidebar";
import Backdrop from "../components/Backdrop";

const Docdashboard = () => {
  return (
    <div>
      <Toolbar />
      <Backdrop />
      <Sidebar />
    </div>
  );
};

export default Docdashboard;
